/*Table structure for table `administrators_user` */

DROP TABLE IF EXISTS `administrators_user`;

CREATE TABLE `administrators_user` (
  `id` varchar(5) NOT NULL COMMENT '管理员用户ID',
  `Administrators_ph` varchar(11) NOT NULL COMMENT '手机号',
  `administrators_pw` varchar(15) NOT NULL COMMENT '密码',
