/*Table structure for table `buy_user` */

DROP TABLE IF EXISTS `buy_user`;

CREATE TABLE `buy_user` (
  `id` varchar(10) NOT NULL COMMENT '用户ID',
  `name` varchar(20) DEFAULT NULL COMMENT '用户姓名',
  `hp` mediumblob COMMENT '头像',
  `sex` char(1) DEFAULT NULL COMMENT '性别',
  `ph` varchar(11) NOT NULL COMMENT '手机号',
  `pw` varchar(15) NOT NULL COMMENT '密码',
  `buy_area` varchar(20) DEFAULT NULL COMMENT '所在地',
  `ts` datetime NOT NULL COMMENT '注册时间',
  `mail` varchar(20) DEFAULT NULL COMMENT '邮箱',
  `buy_num` int(5) unsigned zerofill NOT NULL COMMENT '购买订单',
  `consume_price` float unsigned zerofill NOT NULL COMMENT '消费金额',
  `state` varchar(5) NOT NULL DEFAULT '未登录' COMMENT '登录状态',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

