/*Table structure for table `order_l` */

DROP TABLE IF EXISTS `order_l`;

CREATE TABLE `order_l` (
  `id` varchar(50) NOT NULL COMMENT '订单编号',
  `buy_name` varchar(20) NOT NULL COMMENT '购买用户',
  `order_content` varchar(30) NOT NULL COMMENT '订单内容',
  `order_price` float unsigned zerofill NOT NULL COMMENT '订单金额',
  `ts` datetime NOT NULL COMMENT '创建时间',
  `buy_id` varchar(10) NOT NULL COMMENT '客户ID',
  `pay` varchar(5) DEFAULT NULL COMMENT '支付方式',
  `state` varchar(5) NOT NULL DEFAULT '未支付' COMMENT '支付状态',
  `evaluate` varchar(200) DEFAULT NULL COMMENT '评价',
  PRIMARY KEY (`id`),
  KEY `constraint_idl` (`buy_id`),
  CONSTRAINT `constraint_idl` FOREIGN KEY (`buy_id`) REFERENCES `buy_user` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

