/*Table structure for table `provider` */

DROP TABLE IF EXISTS `provider`;

CREATE TABLE `provider` (
  `ID` varchar(32) NOT NULL,
  `NAME` varchar(16) DEFAULT NULL,
  `PROVIDER_INFO` varchar(1024) DEFAULT NULL,
  `CELLPHONE` varchar(16) DEFAULT NULL,
  `LOGIN_ID` varchar(64) DEFAULT NULL,
  `PASSWORD` varchar(128) DEFAULT NULL,
  `PROVIDER_IMG` mediumblob,
  `REGION_ID` varchar(96) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `REGISTER_TIME` varchar(50) DEFAULT NULL,
  `STATUS` int(22) DEFAULT NULL,
  `AUTH_FILE` mediumblob,
  `WEIXIN` varchar(16) DEFAULT NULL,
  `QQ` varchar(16) DEFAULT NULL,
  `WORK_TIME` varchar(64) DEFAULT NULL,
  `EMAIL` varchar(64) DEFAULT NULL,
  `RECOMMEND` int(22) DEFAULT NULL,
  `PROVIDER_INTRODUCE` varchar(1024) DEFAULT NULL,
  PRIMARY KEY (`ID`),
  KEY `NAME` (`NAME`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

