/*Table structure for table `provider_product` */

DROP TABLE IF EXISTS `provider_product`;

CREATE TABLE `provider_product` (
  `ID` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `PROVIDER_ID` varchar(1000) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `SERVICE_NAME` varchar(1000) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `SERVICE_IMG` mediumblob,
  `SERVICE_CONTENT` varchar(1000) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `PRICE` int(22) DEFAULT NULL,
  `STATUS` int(22) DEFAULT NULL,
  `RECOMMEND` int(100) DEFAULT NULL,
  `HIGH_QUALITY` int(100) DEFAULT NULL,
  `CREATE_TIME` date DEFAULT NULL,
  `SALE_NUM` int(100) DEFAULT NULL,
  `PROVIDER_NAME` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  PRIMARY KEY (`ID`),
  KEY `p1` (`PROVIDER_ID`),
  KEY `p2` (`PROVIDER_NAME`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

