/*Table structure for table `service_order` */

DROP TABLE IF EXISTS `service_order`;

CREATE TABLE `service_order` (
  `SERVICE_NO` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `MEMBER_ID` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `SERVICE_ID` varchar(1000) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `TOTAL_PRICE` int(255) DEFAULT '0',
  `STATUS` int(22) DEFAULT '0',
  `CREATE_TIME` date DEFAULT NULL,
  `PAY_TYPE` int(22) DEFAULT '0',
  `CONTENT` varchar(1024) DEFAULT NULL,
  PRIMARY KEY (`SERVICE_NO`),
  KEY `s1` (`MEMBER_ID`),
  KEY `s2` (`SERVICE_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

