/*Table structure for table `service_product` */

DROP TABLE IF EXISTS `service_product`;

CREATE TABLE `service_product` (
  `id` varchar(5) NOT NULL COMMENT '服务产品ID',
  `imag` mediumblob COMMENT '服务产品图片',
  `service_name` varchar(30) NOT NULL COMMENT '服务名称',
  `service_explain` varchar(50) NOT NULL COMMENT '服务说明',
  `service_price` float unsigned zerofill NOT NULL COMMENT '服务价格',
  `service_state` varchar(5) NOT NULL DEFAULT '0' COMMENT '服务状态',
  `ts` datetime NOT NULL COMMENT '创建时间',
  `sales_volume` int(5) unsigned zerofill NOT NULL COMMENT '销量',
  `service_id` varchar(5) NOT NULL COMMENT '服务商ID外键',
  `name` varchar(20) NOT NULL COMMENT '服务商名称外键',
  `recommend` varchar(5) DEFAULT NULL COMMENT '是否推荐',
  `entrepreneurship` varchar(5) DEFAULT NULL COMMENT '是否初创必备',
  PRIMARY KEY (`id`),
  KEY `constraint_id` (`service_id`),
  CONSTRAINT `constraint_id` FOREIGN KEY (`service_id`) REFERENCES `service_user` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

