/*Table structure for table `service_user` */

DROP TABLE IF EXISTS `service_user`;

CREATE TABLE `service_user` (
  `id` varchar(5) NOT NULL COMMENT '服务商用户ID',
  `hp` mediumblob COMMENT '服务商头像',
  `name` varchar(20) NOT NULL COMMENT '服务商名称',
  `area` varchar(20) NOT NULL COMMENT '服务商地区',
  `service_ph` varchar(11) NOT NULL COMMENT '服务商电话',
  `service_pw` varchar(15) NOT NULL COMMENT '服务商密码',
  `admin_introduction` varchar(100) NOT NULL COMMENT '给管理员看的服务商简介',
  `state` varchar(5) NOT NULL DEFAULT '0' COMMENT '服务商登录状态',
  `mail` varchar(20) DEFAULT NULL COMMENT '邮箱',
  `ts` datetime NOT NULL COMMENT '创建时间',
  `user_introduction` varchar(100) NOT NULL COMMENT '给用户看的服务商简介',
  `work_ts` varchar(10) NOT NULL COMMENT '工作时间',
  `qq` varchar(12) NOT NULL COMMENT 'QQ',
  `wx` varchar(20) NOT NULL COMMENT '微信',
  `customer_ph` varchar(11) NOT NULL COMMENT '客服电话',
  `business_license` mediumblob COMMENT '营业执照',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

